import React, { Component } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Tab from './Pages/Table';
import Result from './Pages/Result';
import AddCar from './Pages/AddCar';
import ChangeOwner from './Pages/ChangeOwner';
import Navi from './Pages/Navi';

class Dashboard extends Component {
  state = {
    cars: [{ "Key": "", "Record": { "make": "", "model": "", "colour": "", "owner": "" } }]
  };


  render() {
    return (
      <div className='container'>
        <Navi />
        <Router>
          <Route exact path='/' render={props => (
            <React.Fragment>
              <div className='table'>
                <Tab cars={this.state.cars} />
                {console.log(this.state.cars)}
              </div>
            </React.Fragment>
          )} />

          <Route exact path='/search' render={props => (
            <React.Fragment>
              <Result />
              <div>
                {console.log(this.state.cars)}
              </div>
            </React.Fragment>
          )} />

          <Route exact path='/addCar' render={props => (
            <React.Fragment>
              <AddCar />
              <div>
                {console.log(this.state.cars)}
              </div>
            </React.Fragment>
          )} />

          <Route exact path='/changeOwner' render={props => (
            <React.Fragment>
              <ChangeOwner />
              <div>
                {console.log(this.state.cars)}
              </div>
            </React.Fragment>
          )} />
        </Router>
      </div>
    );
  }
}

export default Dashboard;
